        }

            flex-wrap: nowrap;

        }

        }

            box-shadow: 0 2px 8px rgba(0,0,0,0.05);

            padding: 10px;
            text-align: center;

        th {

        }
        tbody tr:nth-child(even) {

        }
        tbody tr:hover {
            background-color: #d6eaf8;
            cursor: pointer;
        }
        tbody tr.selected {
            background-color: #fef3b8 !important;
        }
        .chart {
            margin-top: 30px;
        }
        #toggleRadar {
            margin-top: 10px;
            background-color: #3498db;
            color: white;
            border: none;
            padding: 8px 14px;
            cursor: pointer;
            font-weight: bold;
        }

    const colorPalette = ['#1f77b4','#ff7f0e','#2ca02c','#d62728','#9467bd','#8c564b','#e377c2','#7f7f7f','#bcbd22','#17becf'];

    window.onload = function () {
        const clusterSelect = document.getElementById("clusterSelect");
        Object.keys(data).forEach(cluster => {
            const option = document.createElement("option");
            option.value = cluster;
            option.text = cluster;
            clusterSelect.appendChild(option);
        });
        updateCluster();
    };

    function updateCluster() {
        const cluster = document.getElementById("clusterSelect").value;
        const elements = Object.keys(data[cluster]);
        const values = Object.values(data[cluster]);

        // Highlight the selected dropdown option
        const options = document.querySelectorAll("#clusterSelect option");
        options.forEach(opt => {
            opt.style.backgroundColor = opt.value === cluster ? "#fef3b8" : "";
        });

        // Update validation
        const total = values.reduce((a, b) => a + b, 0);
        document.getElementById("validationNote").textContent =
            "Total: " + total.toFixed(2) + "%" + (Math.abs(total - 100) > 2 ? " ⚠️ Check." : " ✓ OK");

        // Bar Plot
        Plotly.newPlot('barPlot', [{
            x: elements,
            y: values,
            type: 'bar',
            marker: { color: colorPalette }
        }], {
            title: cluster + ' – Elemental Bar Plot',
            template: 'plotly_white'
        });

        // Spectrum Plot
        const yvals = spectrum[cluster];
        const xvals = Array.from({length: yvals.length}, (_, i) => i);
        Plotly.newPlot('spectrumPlot', [{
            x: xvals,
            y: yvals,
            type: 'scatter',
            mode: 'lines',
            line: { color: '#e74c3c' }
        }], {
            title: cluster + ' – EDS Spectrum',
            xaxis: { title: 'Energy Channel' },
            yaxis: { title: 'Intensity' },
            template: 'plotly_white'
        });

        // Radar Plot (preload hidden)
        Plotly.newPlot('radarPlot', [{
            type: 'scatterpolar',
            r: values,
            theta: elements,
            fill: 'toself',
            line: { color: '#e67e22' }
        }], {
            title: cluster + ' – Radar Composition',
            template: 'plotly_white',
            polar: { radialaxis: { visible: true } }
        });

        // Table update
        const tbody = document.querySelector("#dataTable tbody");
        tbody.innerHTML = "";
        elements.forEach((el, i) => {
            const row = document.createElement("tr");
            row.innerHTML = `<td>${el}</td><td>${values[i].toFixed(2)}</td>`;
            row.addEventListener("click", () => {
                highlightRow(row);
                showElementAcrossClusters(el);
            });
            tbody.appendChild(row);
        });
    }

    function highlightRow(row) {
        document.querySelectorAll("#dataTable tbody tr").forEach(r => r.classList.remove("selected"));
        row.classList.add("selected");
    }

    function toggleRadarPlot() {
        const radar = document.getElementById("radarPlot");
        radar.style.display = (radar.style.display === "none") ? "block" : "none";
    }

    function showElementAcrossClusters(element) {
        const clusters = [], values = [];
        for (const cluster in data) {
            clusters.push(cluster);
            values.push(data[cluster][element] || 0);
        }

        Plotly.newPlot('elementPieChart', [{
            type: 'pie',
            labels: clusters,
            values: values,
            textinfo: 'label+percent',
            hoverinfo: 'label+value'
        }], {
            title: "Distribution of '" + element + "' Across Clusters",
            template: 'plotly_white'
        });

        Plotly.newPlot('multiClusterChart', [{
            type: 'bar',
            x: clusters,
            y: values,
            marker: { color: '#3498db' }
        }], {
            title: "Weight % of '" + element + "' Across Clusters",
            xaxis: { title: 'Cluster' },
            yaxis: { title: 'Weight %' },
            template: 'plotly_white'
        });
    }
</script>
